import React from 'react';
class readData extends React.Component
{
  constructor(props)
  {
    super(props);
    this.jsonData=this.props.jsonData;
  }
  readData(jsonData)
  {
    var ret="";
    for(let data in jsonData)
    {
      if(typeof(jsonData[data])=="object")
        readData(jsonData[data]);
      if(typeof(jsonData[data])!="object" && data!="Brand")
        return ( 
          <div>{data} : {jsonData[data]}</div>
        );
    }
    return <div>{ret}</div>;
  }
  render()
  {
    return (
      <div>{this.readData(this.jsonData)}</div>
    );

  }
}
export default readData;
